import React, { useState } from "react";
import Form from "./Form";

function App() {
  const [allUser, setAllUsers] = useState([]);

  return (
    <div>
      <Form setUsers={setAllUsers} />
      {allUser.length === 0 ? <p>Ingen brukere lagt til</p> : <p>Brukere</p>}
    </div>
  );
}

export default App;
